import React from 'react';
import Card from './Card';
import Sdata from './Sdata';

const Amazon = () => {
    return(
        <Card
          key={Sdata[5].id}
          imgsrc={Sdata[5].imgscr}
          sname={Sdata[5].sname}
          title={Sdata[5].title}
          link={Sdata[5].link}
        />
  );
}

export default Amazon;
